import logo from "./images/logo.png";

const propsColumnOfListTypeNovels = column => {
    column.cssTd = "item-sub-hover";
    column.colSpan = 1;
    column.cssLink = "d-flex align-items-center item";
    column.cssIcon = "d-block fa fa-tags";
    column.cssType = "d-inline-block pl-item";
    column.title = column.type.includes("Truyện") ? column.type : ("Truyện " + column.type);
}

const listOfTypeNovels = {rows: [
    [{type: "Tiên Hiệp"}, {type: "Kiếm Hiệp"}], [{type: "Ngôn Tình"}, {type: "Truyện Teen"}], [{type: "Đô Thị"}, {type: "Quân Sự"}], 
    [{type: "Lịch Sử"}, {type: "Xuyên Không"}], [{type: "Truyện Ma"}, {type: "Trinh Thám"}], [{type: "Huyền Huyễn"}, {type: "Khoa Huyễn"}], 
    [{type: "Dị Giới"}, {type: "Võng Du"}], [{type: "Truyện Ngắn"}, {type: "Truyện Cười"}], [{type: "Tiểu Thuyết"}, {type: "Review"}]
]};

listOfTypeNovels.rows.map(row => row.map(propsColumnOfListTypeNovels));
listOfTypeNovels.rows[8][1].title = "Review Truyện";



const dataNotUpdate = {logo, listOfTypeNovels};

export default dataNotUpdate;
